import React from 'react';

const CharBox = () => {
    return (
        <>
            <div className="CharBox">
                <div className="ChampImg"><img src="https://ddragon.leagueoflegends.com/cdn/9.21.1/img/champion/Garen.png"/></div>
            </div>
        </>
    );
}

export default CharBox;
